import Dexie from 'dexie'
import React from 'react'

 
function AddMore() {

 
  const handleClick = () => {
    var db = new Dexie('homie');
    db.version(1).stores({
        friends: 'name, race'
    })

    db.open().catch(function(){
        alert("unable to open");
    });



  };
 
  return <button onClick={handleClick}>Add</button>;
}

export default AddMore
